import React, { Component } from 'react'
import { Route } from "react-router-dom";
import "../../styles/navbar/navbar.scss";
import Logo from "../../images/NHSCT.png";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faUser, faSignInAlt, faGraduationCap } from "@fortawesome/free-solid-svg-icons"


export default class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="navbarContainer">
                <header className="header">
                    <nav ckasName="navBar">
                        <div className="logo">
                            <img width="100%" padding="5px" src={Logo} alt="logo" />
                            <a onClick={() => {
                                window.location.href = "/home";
                            }} />
                        </div>
                        <div className="navComponents">
                            <ul>
                                <li>
                                    <FontAwesomeIcon icon={faGraduationCap} style={{ color: "darkgray" }} />
                                </li>
                                <li>
                                    <FontAwesomeIcon icon={faUser} style={{ color: "darkgray" }} />
                                </li>
                                <li>
                                    <FontAwesomeIcon icon={faSignInAlt} style={{ color: "darkgray" }} />
                                </li>
                                <li>

                                </li>
                            </ul>

                        </div>
                    </nav>
                </header>
            </div>
        );
    }
}
